import React, { Component } from "react";
import { Route,Switch} from "react-router-dom";
import Body from "../HomePage/Body.js";
import ShrimpOrder from "../Orders/ShrimpOrder";
import ShrimpSelling from "../Orders/ShrimpSelling";
import SignIn from "../SignIn/SignIn";
class RouterURL extends Component{
    render(){
        return(
            <div>
                <Switch>
                 <Route exact path="/" component={Body}/>
                 <Route path="/trao-doi/dang-ban" component={ShrimpOrder}/>
                 <Route path="/trao-doi/dat-mua-tom" component={ShrimpSelling}/>
                 <Route path="/sign-in" component={SignIn}/>
                 <Route component={Body}/>
                </Switch>
             </div>

              );
      }

}
export default RouterURL;
